import React from "react";
import "../App.css";

function HomePage() {
  return (
    <div className="container">
      <h2>This is Home Page</h2>
      <h2>Welcome to my shop</h2>
      <p>Order Groceries at your local store</p>
      <p>Click tab above to order</p>
    </div>
  );
}

export default HomePage;
